import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel } from "antd";
// import "../../static/css/style.scss";
class Login extends Component {
  render() {
    return (
      <div className="data">
        <Layout>
          <Row>
            <Col span={12} md={12} xs={24}>
              Login Page
            </Col>
          </Row>
        </Layout>
      </div>
    );
  }
}

export default Login;
